import React from "react";

const Input = ({ label, placeholder, value, type, handleChange, name }) => {
	return (
		<div className="inputWrapper">
			{label && <label>{label} </label>}
			<input
				placeholder={placeholder}
				value={value}
				type={type}
				name={name}
				onChange={handleChange}
			/>
		</div>
	);
};

export default Input;
